import React from "react";

function Nav(props) {
  console.log(props);
  return (
    <div>
      <section className="et-hero-tabs">
    <h1>Marquise Piton</h1>
    <h3>I build websites as If I am telling a story </h3>
    <div className="et-hero-tabs-container">
      <a className="et-hero-tab" href="#tab-weeks">Weeks</a>
      <a className="et-hero-tab" href="#tab-photos">Photos</a>
      <a className="et-hero-tab" href="#tab-articles">Articles</a>
      <a className="et-hero-tab" href="#tab-projects">Projects</a>
      <a className="et-hero-tab" href="#tab-aboutMe">About Me</a>
      <span className="et-hero-tab-slider"></span>
    </div>
  </section>
    </div>

  );
}

export default Nav;
